Hi John Welcome!

Kristin



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
simianparanormal
Sent: Monday, March 24, 2008 9:04 PM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] Hi Everyone!



Hey there,

Just wanted to say hi to everyone. I just joined the group and 
inerested to see what everyone has to say. I run a team here in Omaha, 
Nebraska called Simian Paranormal. We mainly focus on EVP but also in 
scientific paranormal investigation. I am a former audio specialist 
from P.R.I.S.M. out of Omaha. Really looking forward to chatting with 
everyone and seeing what everyone is coming up with. If your from 
around the midwest hit me up and we can chat about local haunts. Cheers 
Everyone and Happy Hunting :)

John Shrimpton
Simian Paranormal Research




